    false,nt"url": null,nt"notes": "Preliminary review of the data reveals
    that all lakes surveyed can be classified as having low conductibility, ranging
    from the low 20's for the Goodnews Lakes to the high 80's for Heart Lake, an alpine
    landlocked lake. pH ranged from the mid 6's for the Goodnews Lakes to 8.0 for Heart
    Lake, but in general the waters can be described as neutral. Dissolved oxygen was
    at or near saturation levels for all waters. Still lakes showed some stratification
    with regard to temperature, but larger windblown lakes, Togiak, Kagati, Goodnews,
    etc., were well mixed. Temperatures on the wind mixed lakes varied less than 2 degrees
    C between the surface and meters. Secchi disk readings averaged 8 meters.",nt"license_title":
